import { useState } from 'react';
import { createCalculator } from '../api';

function Admin() {
  const [name, setName] = useState('');
  const [type, setType] = useState('');
  const [defaultRate, setDefaultRate] = useState('');
  const [fields, setFields] = useState('');
  const [description, setDescription] = useState('');
  const [message, setMessage] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // Обрабатываем поля
    const newCalculator = {
      name,
      type,
      description,
      defaultRate: parseFloat(defaultRate),
      fields: fields.split(',').map(field => field.trim())
    };

    try {
      await createCalculator(newCalculator);
      setMessage('Калькулятор успешно добавлен!');
    } catch (error) {
      setMessage('Ошибка при добавлении калькулятора.');
    }
  };

  return (
    <div>
      <h2>Админ-панель</h2>
      <p>Управление калькуляторами.</p>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Название калькулятора:</label>
          <input 
            type="text" 
            value={name} 
            onChange={(e) => setName(e.target.value)} 
            required 
          />
        </div>
        <div>
          <label>Тип калькулятора:</label>
          <input 
            type="text" 
            value={type} 
            onChange={(e) => setType(e.target.value)} 
            required 
          />
        </div>
        <div>
          <label>Ставка по умолчанию:</label>
          <input 
            type="number" 
            value={defaultRate} 
            onChange={(e) => setDefaultRate(e.target.value)} 
            required 
          />
        </div>
        <div>
          <label>Поля калькулятора (через запятую):</label>
          <input 
            type="text" 
            value={fields} 
            onChange={(e) => setFields(e.target.value)} 
            required 
          />
        </div>
        <div>
          <label>Описание калькулятора:</label>
          <textarea 
            value={description} 
            onChange={(e) => setDescription(e.target.value)} 
            required 
          />
        </div>
        <button type="submit">Добавить калькулятор</button>
      </form>
      {message && <p>{message}</p>}
    </div>
  );
}

export default Admin;
